import React from 'react';
import './Hello.css';

const Hello = (props) => {
	return (
		<div className ="f1 tc">	
			<h1> Hello world </h1>
			<p> {props.greeting} </p>
			<p>{props.goodbye}</p>
		</div>
	)
};
// function Hello () {
// 	return <h1> Hello world </h1>;
// };

export default Hello;
